this.fs.stat(path, function(err, stat) {
		if(err === null) {
			if(stat.isDirectory()) {
				// console.log('文件夹存在');
				callback (2);
			} else if(stat.isFile()) {
				// console.log('文件存在');
				callback (1);
			} else {
				// console.log('路径存在，但既不是文件，也不是文件夹');
				// //输出路径对象信息
				// console.log(stat);
				callback (0);
			}
		} else if(err.code == 'ENOENT') {
			// console.log(err.name);
			// console.log('路径不存在');
			callback (0);
		} else {
			// console.log('错误：' + err);
			callback (0);
		}
	});

if (req.method == "POST") {
		this.getParam (req, rsp, callback);
	} else {
		callback (req, rsp, {});
	}

var postData = "";

	// 执行回调函数
	var cb = function () {
		callback (req, rsp, this.qry.parse(postData));
	};

	if (req.method == "GET") {
		postData = this.parseUrl(req).query;
		cb();
	} else if (req.method == "POST") {
		// 设置接收数据编码格式为 UTF-8
		req.setEncoding("utf8");

		// 因为nodejs在处理post数据的时候，会将数据分成小包来序列处理。所以必须监听每一个数据小包的结果
		req.addListener("data", function (postDataChunk) {
			postData += postDataChunk;
		});

		// 所有数据包接收完毕
		req.addListener("end", cb);
	}

if (!dir) {
		dir = process.cwd();
	}
	return this.path.join(dir, uri);
